import React, { Component } from 'react'
import download from './download.png';
import {BrowserRouter as Router, Routes, Link, Route} from 'react-router-dom'
export default class StudentDocuments extends Component {
  render() {
    const onButtonClick = () => {
     
        fetch("ApplicationForGraduateWork.pdf").then((response) => {
            response.blob().then((blob) => {
             
    
                const fileURL =
                    window.URL.createObjectURL(blob);
                     
            
                let alink = document.createElement("a");
                alink.href = fileURL;
                alink.download = "SamplePDF.pdf";
                alink.click();
            });
        });
    };
    return (
      <>
      <table class="stud_table">
  <tr>
  <td>
  <button onClick={onButtonClick}>Скачать документ</button> </td>
      <td>
<img src={download} width="20" height="20" alt="profile_pic" loading="lazy" id="pdfButton" />
      </td>
  </tr>
   <tr>
  <td>
      Заявление на смену темы ВКР
  </td>
      <td> <img src={download} width="20" height="20" alt="profile_pic" loading="lazy"/> </td>
  </tr>
    <tr>
  <td>Титульный лист пояснительной записки</td>
      <td> <img src={download} width="20" height="20" alt="profile_pic" loading="lazy"/> </td>
  </tr>
    <tr>
    <td>Заявление о согласии  на размещение выпускной квалификационной работы в электронно-библиотечной
        среде ФГАОУ ВО СФУ</td>
      <td> <img src={download} width="20" height="20" alt="profile_pic" loading="lazy"/> </td>
    </tr>

   <tr>
    <td>Заявление на последипломный отпуск</td>
      <td> <img src={download} width="20" height="20" alt="profile_pic" loading="lazy"/> </td>
</tr>
  <tr>
    <td>Заявление о необходимости специальных условий</td>
      <td> <img src={download} width="20" height="20" alt="profile_pic" loading="lazy"/> </td>
</tr>
</table>

 <div class='complex_vkr'>
 <details>
    <summary>Комплексная ВКР</summary>
   <table width="95%" class="stud_table">
     <tr>
    <td>Заявление на ВКР (комплексная ВКР)</td>
      <td> <img src={download} width="20" height="20" alt="profile_pic" loading="lazy"/> </td>
</tr>
  <tr>
    <td>Форма титульного листа (комплексная ВКР)</td>
      <td> <img src={download} width="20" height="20" alt="profile_pic" loading="lazy"/> </td>
</tr>
</table>
                </details>
               </div>
      </>
    )
  }
}
